    <div className="thank-container">
      <div className="thank-text">
        <h1>Thank You!</h1>
      </div>
      <div className="thank-body">
        <p>
          Thank you for confirming your subscription! We hope you have<br></br>
          fun using our platform. If you ever need support, please feel{' '}
          <br></br> free to mail us at support@loremgaming.com
        </p>
      </div>
    </div>
  );
}
